import "./Home.css";
import { useNavigate } from "react-router-dom";
import { useDispatch, useSelector } from "react-redux";
import axios from "axios";
import { setTitle } from "./addTask";

function Home() {
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const { title } = useSelector((state) => state.mySlice4);

  const addTask = async () => {
    try {
      const token = JSON.parse(localStorage.getItem("userData"));
      let bodyContent = {
        title: title,
      };
      let headers = {
        Authorization: `Bearer ${token.accessToken}`,
      };
      let reqOptions = {
        url: "https://task-nhar.onrender.com/todo/createTodo",
        method: "POST",
        data: bodyContent,
        headers: headers,
      };

      let response = await axios.request(reqOptions);
      console.log(response.data);
      getAll();
    } catch (e) {
      console.log(e);
    }
  };

  const getAll = async () => {
    try {
      const token = JSON.parse(localStorage.getItem("uesrData"));
      let header1 = {
        Authorization: `Bearer ${token.accessToken}`,
      };
      let reqOptions = {
        url: "https://task-nhar.onrender.com/todo/getAll",
        method: "GET",
        headers: header1,
      };
      let response1 = await axios.request(reqOptions);
      console.log(response1.data);
    } catch (e) {
      console.log(e);
    }
  };
  useEffect(() => {
    getAll();
  }, []);

  function Log_out() {
    navigate("/Login");
    localStorage.clear();
    window.location.reload();
  }
  return (
    <div className="Task-1">
      <header className="header-1">
        <div className="Head-1">
          <h4>TODO App</h4>
        </div>
        <div className="Head-2">
          <p>Profile</p>
          <p onClick={Log_out}>Logout</p>
        </div>
      </header>
      <div className="form-3">
        <input
          type="text"
          placeholder="Title"
          className="input3"
          value={title}
          onChange={(e) => dispatch(setTitle(e.target.value))}
        />
        {/* <input type="text" placeholder="Description" className="input3" /> */}
        <button
          id="Add-btn"
          className="input3"
          onClick={(e) => {
            addTask();
          }}
        >
          ADD TO TASK
        </button>
      </div>
      <div className="tabel-di">
        <table className="table-1" cellspacing="0">
          <tr>
            <th>TITLE</th>
            <th>DESCRIPTION</th>
            <th>STATUS</th>
            <th>DELETE</th>
          </tr>
          <tr>
            <td>Project</td>
            <td>inprogress</td>
            <td>
              <input type="checkbox" />
            </td>
            <td>Delete</td>
          </tr>
          <tr>
            <td>Lunch</td>
            <td>at 2pm today</td>
            <td>
              <input type="checkbox" />
            </td>
            <td>Delete</td>
          </tr>
          <tr>
            <td>English Class</td>
            <td>at 8pm</td>
            <td>
              <input type="checkbox" />
            </td>
            <td>Delete</td>
          </tr>
          <tr>
            <td>Market</td>
            <td>Have to go market to buy milk at 7am</td>
            <td>
              <input type="checkbox" />
            </td>
            <td>Delete</td>
          </tr>
        </table>
      </div>
    </div>
  );
}

export default Home;
